//用一个字节的字符替换2个字节的中文字,达到数据压缩的目的,解压缩的消耗可以忽略不计
var replaceChar='1234567890qwertyuiopasdfghjklzxcvbnmQWERTYUIOPASDFGHJKLZXCVBNM `-=[]/~!@#$%^&*()_+{}|:"<>?'.split('');
var decodeChar='县区市族山城治自州阳江南安新东平河宁西镇海龙旗大川北开兴尔水昌武湖中金高德溪源临长林台石永发克和丰清陵口都沙青云定化苗华巴省通拉古乌白阿吉彝黄家济天乐乡兰田桥广泉原庆子哈回门顺宜特'.split('');


function getValue(str){
    var result=str;
 
    for(var i=0;i<replaceChar.length;i++){
        var char=replaceChar[i];
        var index=result.indexOf(char);
        while(index>-1){
            result=result.replace(char,decodeChar[i]);
            index=result.indexOf(char);
        }
    }
    return result;
}

var regions=[];

var arr1=region.split('.');
var arr2,arr3;
for(var i=0;i<arr1.length;i++){
    arr2=arr1[i].split(';');
    var provinceName=getValue(arr2[0]);

    var city=[];
    var province={name:provinceName,city:city};

    for(var j=1;j<arr2.length;j++){
        arr3=arr2[j].split(',');
        var cityName=getValue(arr3[0]);
        var area=[];
        city.push({name:cityName,area:area});
  
        for(var k=1;k<arr3.length;k++){
            area.push(getValue(arr3[k]));
        }
    }
    regions.push(province);
}

